function Stock(props){
    const stock=props.stock
    const price='$'+stock.current_price
    return(
        <tr>
            <td>{stock.name}</td>
            <td>{stock.symbol}</td>
            <td>{price}</td>
            <td>{stock.market_cap}</td>
        </tr>
    )
}
export default Stock
